import React from "react";
import { NavigationContainer } from "@react-navigation/native";
import { createStackNavigator } from "@react-navigation/stack";
import HomeScreen from "./src/HomeScreen";
import DieRollScreen from "./src/DieRollScreen";
import { StyleSheet } from 'react-native';

const Stack = createStackNavigator();

export default function App() {
  return (
      <NavigationContainer color="#2b1d0e">
      <Stack.Navigator color="#2b1d0e">
        <>
          <Stack.Screen name="Menu" component={HomeScreen} color="#2b1d0e" />
          <Stack.Screen name="Die Roll" component={DieRollScreen} />
        </>
      </Stack.Navigator>
    </NavigationContainer>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: 'black',
    alignItems: 'center',
    justifyContent: 'center',
  },
});
